import React from 'react';

const Img1 = () => {
  return (
    <div className="relative w-64 h-64 flex justify-center items-center mx-auto bg-blue-800">
      {/* Fiecare cerc păstrează culoarea sa distinctă când nu se suprapune */}
      <div className="absolute w-32 h-32 bg-red-800 rounded-full mix-blend-screen"></div>
      <div className="absolute w-32 h-32 bg-green-800 rounded-full mix-blend-screen" style={{ transform: 'translateX(50%)' }}></div>
      <div className="absolute w-32 h-32 bg-blue-800 rounded-full mix-blend-screen" style={{ transform: 'translateY(50%)' }}></div>
    </div>
  );
};

export default Img1;
